// fn fmr(a: i32) -> i16 {
//   (
//     -((625*(a&65535))>>4)
//     + 3329 * ( ( (a&65280)>>7 ) + ( (a&65280)>>8 ) + ( (a & 192) >> 6 ) )
//     + (a >> 16)
//   ) as i16
// }

// fn fmr(a: i32) -> i16 {
//   (
//     -(2559999>>16)*(a&65535)
//     + 3329 * ( ( (a&65280)>>7 ) + ( (a&65280)>>8 ) + ( (a & 192) >> 6 ) )
//   ) as i16
// }

fn fmr(a: i32) -> i16 {
  (
    a*169
        - 3329 * ( ( (a & 65535) >> 4) - ( (a&65280)>>7 ) - ( (a&65280)>>8 ) - ( (a & 192) >> 6 ) )
        + (a >> 16)
  ) as i16
}

pub fn basemul_m(r: &mut[i16], a: &[i16], b: &[i16], zeta: i16)
{
  let ab: i32 = a[1]as i32 *b[0] as i32 + a[0]as i32 *b[1] as i32;
  let a1b1z: i32 = a[1]as i32 *b[1] as i32;

  let mut best_mont = 0;
  let mut best_fmr = 0;
  let mut pareggio = 0;
  let mut count = 0;
  // let mut m = [0i32; 4096];
  let half = (i16::MAX) as usize;
  let mut mon = [0i16; (i16::MAX) as usize];
  for i in 0..(half) {
    count += 1;
    if i < 1 {
      continue;
    }
    let b = i as i32;
    mon[i] = montgomery_reduce(b);
    if mon[i] - mon[i-1] == -3160 && mon[i-1] - mon[i-2] == 169 {
      println!("{}", count);
      count = 0;
    }
  }
  for i in 0..6000 {
    let now2 = Instant::now();
    montgomery_reduce(i-6000);
    let elapsed2 = now2.elapsed().as_nanos();
    // println!("Montgomery: {}", elapsed2);
    let now = Instant::now();
    // let c = i as i32;
    // m[((c & 65535) >> 4) as usize] = 3329 * ( ( (c & 65535) >> 4) - ( ( (c&65280)>>7 ) + ( (c&65280)>>8 ) ) - ( (c & 192) >> 6 ) );
    fmr(i-6000);
    let elapsed = now.elapsed().as_nanos();
    // println!("FMR: {}\n\n", elapsed);
    if elapsed2 < elapsed {
      best_mont += 1;
    }else if elapsed2 == elapsed {
      pareggio += 1;
    }else{
      best_fmr += 1;
    }
  }
  // println!("M {:?}", m);
  println!("Best mont: {}", best_mont);
  println!("Best fmr: {}", best_fmr);
  println!("Best pareggio: {}\n", pareggio);

  r[0] = fmr(fmr(a[1]as i32 *b[1] as i32) as i32 * zeta as i32 + a[0] as i32 * b[0] as i32);
  r[1] = fmr(a[1]as i32 *b[0] as i32 + a[0]as i32 *b[1] as i32);
}

